⁣
I’m making it MY goal to help you set REAL goals for the rest of this year. Goals that you can follow, goals that have meaning behind them, goals that you will be driven to achieve.
⁣
GOALS is the theme of my upcoming accountability group and I’m telling you, you don’t want to miss this. I am going to dive into creating goals with you and we are going to bust through a lot of limiting beliefs that you likely have surrounding your goals. By the end of this group, you are going to have a crystal clear idea of WHAT you want and HOW to get it.
⁣
Here’s a quick tip on goal-setting: write out each of your goals and make sure they follow these guidelines...
⁣
S: specific
M: measurable
A: achievable
R: relevant
T: time-based
⁣
